ultes et les enfants de 6 ans et plus.";}s:9:"Clonidine";a:2:{i:0;s:9:"0.2589225";i:1;s:151:"Conidine est un agent alpha-agoniste hypotensive à diminuer la pression artérielle utilisés seuls ou en combinaison avec d'autres antihypertenseurs.";}s:7:"Benicar";a:2:{i:0;s:7:"0.45486";i:1;s:120:"Benicar est utilisé pour contrôler l'hypertension artérielle chez les adultes et les enfants qui sont au moins 6 ans.";}s:8:"Tenormin";a:2:{i:0;s:8:"0.310688";i:1;s:216:"Tenormin est utilisé le traitement de rythmes du cœur anormalement rapides, hypertension artérielle, angine, infraction myocardial aiguë, tachycardia (les différents types), ventricular fibrillation et d'autres.";}s:6:"Hyzaar";a:2:{i:0;s:7:"0.51984";i:1;s:175:"Hyzaar est utilisé pour traiter la haute pression sanguine. Il peut être utilisé pour diminuer les risques d'un AVC chez certains patients avec une pression sanguine haute.";}s:9:"Lopressor";a:2:{i:0;s:6:"0.6776";i:1;s:113:"Lopressor joue surtout le bloquant du béta-adrenoreceptors du coeur et est utilisé pour traiter l'hypertension.";}s:7:"Inderal";a:2:{i:0;s:5:"0.255";i:1;s:232:"Inderal est utilisée pour traiter des tremblements, une douleur de poitrine, une hypertension, des désordres de rythme du cœur, ischemic la maladie du cœur, hypertrophic cardiomyopathy, myocardiodystrophy et d'autres conditions.";}s:6:"Diovan";a:2:{i:0;s:10:"0.90991494";i:1;s:69:"Diovan est vasodilatator périphérique avec un effet de hypotension.";}s:9:"Toprol XL";a:2:{i:0;s:9:"0.6782468";i:1;s:108:"Toprol XL est utilisé pour traiter la pression artérielle élevée, l'angine, et l'insuffisance cardiaque.";}s:6:"Avapro";a:2:{i:0;s:9:"0.7004816";i:1;s:150:"Les effets d'Avapro incluent vasoconstriction et stimulant l'influence sur l'excrétion d'aldosterone et l'activation de système nerveux sympathique.";}s:7:"Vasotec";a:2:{i:0;s:9:"0.5069295";i:1;s:130:"Vasotec est utilisé pour traiter la pression artérielle élevée, l'insuffisance cardiaque, et les autres problèmes cardiaques.";}s:5:"