ur traiter le diabète de type 2 (non insulino-dépendant). ";}s:6:"Glyset";a:2:{i:0;s:8:"1.753725";i:1;s:149:"Glyset est indiqué comme un complément au régime et l'exercice pour améliorer le contrôle glycémique aux adultes qui ont le diabète de type 2.";}}s:16:"Gastrointestinal";a:32:{s:6:"Nexium";a:2:{i:0;s:7:"0.43206";i:1;s:624:"Diminue la quantité d'acide gastrique produite dans l'estomac. Il est utilisé pour traiter les symptômes du reflux gastro-oesophagien pathologique et d'autres conditions impliquant un excès d'acide gastrique telles que le syndrome de Zollinger-Ellison. On l'utilise également pour promouvoir la guérison de l'oesophagite érosive (endommagement de l'oesophage dû à l'acide gastrique). On peut également administrer ce médicament afin de prévenir les ulcères gastriques causés par une infection à helicobacter pylori (H. pylori) ou par l'utilisation de médicaments anti-inflammatoires non stéroïdiens (AINS).";}s:7:"Aciphex";a:2:{i:0;s:9:"0.5648643";i:1;s:88:"Aciphex est utilisée pour traiter des ulcères dans l'estomac ou la gastrite chronique.";}s:8:"Prevacid";a:2:{i:0;s:10:"0.41987625";i:1;s:343:"Prevacid diminue la quantité d'acide qui est produite dans l'estomac. Il est utilisé pour traiter et prévenir les ulcères d'estomac et intestinaux, l'oesophagite érosive (dommage à l'oesophage causé par l'acide de l'estomac) et d'autres conditions causées par une acidité excessive de l'estomac comme le syndrome de Zollinger-Ellison.";}s:8:"Protonix";a:2:{i:0;s:10:"0.37328445";i:1;s:230:"Protonix est utilisée pour traiter le stade aigu d'ulcères duodénaux ou gastriques, en incluant les provoqués par le traitement avec les médications de non-stéroïde antiinflammatoires, gastroesophageal la maladie de reflux.";}s:7:"Cytotec";a:2:{i:0;s:9:"1.7022225";i:1;s:160:"Cytotec est une médication utilisée pour prévenir la formation d'ulcères de l'estomac dans les patients qui prennent NSAIDs tel que l'aspirine ou ibuprofen.";}s:11:"Allopurinol";a:2:{i:0;s:8:"0.667128";