inger-Ellison).";}s:6:"Biaxin";a:2:{i:0;s:9:"2.3964225";i:1;s:113:"Biaxin est un antibiotique macrolide servant au traitement des infections de la peau et du système respiratoire.";}s:12:"Brand Amoxil";a:2:{i:0;s:10:"0.56669305";i:1;s:70:"Marque Amoxil (Amoxicilline) est utilisé pour traiter les infections.";}s:8:"Decadron";a:2:{i:0;s:9:"0.3492181";i:1;s:253:"Decadron est utilisé pour traiter des conditions telles que l'arthrite, le sang d'hormones et troubles du système immunitaire, des réactions allergiques, la peau et certaines affections oculaires, problèmes de respiration, de l'intestin de certaines";}s:9:"Deltasone";a:2:{i:0;s:9:"0.2911104";i:1;s:153:"Deltasone  est utilisé pour réduire l'inflammation et à réduire les symptômes dans une variété de maladies comme la colite ulcéreuse et l'asthme.";}s:8:"Ditropan";a:2:{i:0;s:5:"2.303";i:1;s:229:"Ditropan est utilisé pour soulager les symptômes de problèmes de vessie (l'impériosité mictonnelle, les besoins fréquents, ou les fuites d'urines, la perte de contrôle de la vessie, et la strangurie) aux certains patients.";}s:9:"Doxazosin";a:2:{i:0;s:7:"0.33345";i:1;s:152:"Doxazosin est utilisé pour traiter l'hypertension artérielle et pour traiter les signes et les symptômes de l'hyperplasie prostatique bénigne (HBP).";}s:8:"Florinef";a:2:{i:0;s:7:"1.03056";i:1;s:172:"Florinef est utilisé pour traiter l'insuffisance surrénale (la maladie d'Addison) et pour le traitement de perte de sel aux patients qui ont le syndrome adréno-génital.";}s:6:"Hytrin";a:2:{i:0;s:8:"0.726408";i:1;s:125:"Hytrin est utilisé pour traiter l'hypertension artérielle et des symptômes de l'hyperplasie bénigne de la prostate (HBP).";}s:6:"Lasuna";a:2:{i:0;s:7:"25.6956";i:1;s:101:"Lasuna ou à l'ail est une herbe efficace utilisée dans la prévention de  l'hypercholestérolémie.";}s:8:"Motilium";a:2:{i:0;s:7:"0.27436";i:1;s:290:"Motilium est utilisé pour arrêter les nausées et les vomissements aux adultes et enfants. Il est également utilisé pour soulag