 Puisqu'il est absorbé directement dans la circulation sanguine, il agit plus rapidement. Il est utilisé pour traiter les problèmes érectiles chez les hommes. Ce médicament nécessite environ 30 minutes pour agir. L'effet est maintenu pendant environ 4 heures.";}s:10:"Cenforce-D";a:2:{i:0;s:6:"2.7846";i:1;s:165:"Cenforce-D est utilisé dans le traitement de la dysfonction érectile avec l'éjaculation précoce. Cenforce-D contient 100 mg de Sildenafil et 60 mg de Dapoxetine.";}}s:15:"Muscle Relaxant";a:22:{s:7:"Robaxin";a:2:{i:0;s:8:"0.419482";i:1;s:137:"Robaxin est un relaxant de muscle qui a utilisé de soulager la douleur de muscle et la gêne provoquée par les entorses et les efforts.";}s:8:"Baclofen";a:2:{i:0;s:10:"0.61210875";i:1;s:237:"Le Baclofen est utilisé pour traiter les spasmes des muscles squelettiques, clonus musculaire, crampes musculaires, la rigidité, lésions de la moelle épinière et la douleur causées par des troubles tels que la sclérose en plaques.";}s:8:"Skelaxin";a:2:{i:0;s:9:"1.5556212";i:1;s:295:"Metaxalone est un relaxant musculaire. Il agit en bloquant l'influx nerveux (ou la sensation de la douleur) dans le cerveau. Metaxalone est utilisé comme traitement d'appoint au repos, à la physiothérapie pour traiter les troubles des muscles squelettiques tels que la douleur ou la blessure.";}s:8:"Zanaflex";a:2:{i:0;s:8:"0.802503";i:1;s:171:"Zanaflex est utilisée pour traiter la contraction de muscle et gênant (du spasme) provoqué par les conditions telles que la sclérose en plaques ou la blessure spinale.";}s:7:"Voveran";a:2:{i:0;s:6:"0.4158";i:1;s:159:"Voveran est utilisé pour traiter la douleur légère à modérée. Il peut également être utilisé pour les autres conditions déterminées par un médecin.";}s:10:"Voveran sr";a:2:{i:0;s:5:"0.165";i:1;s:162:"Voveran SR est utilisé pour traiter la douleur légère à modérée. Il peut également être utilisé pour les autres conditions déterminées par un médecin.";}s:7:"Urispas";a:2:{i:0;s:8:"1.080112";i:1;s:167:"Urispas est utilisé pour soulager la douleur, la fréquence et l'urgence de l'urination ainsi que urinations nocturnes associées aux certaines conditions médicales.";}s:8:"Tegretol";a:2:{i:0;s:8:"0.504792";i:1;s:229:"Tegretol (Carbamazepine) est utilisé pour contrôler certains types de crises épileptiques et pour traiter la douleur aiguë dans la mâchoire ou dans les joues causée par un problème de nerf facial (névralgie du trijumeau).";}s:10:"Tizanidine";a:2:{i:0;s:7:"2.40084";i:1;s:61:"Tizanidine est utilisé pour traiter les spasmes musculaires.";}s:8:"Shallaki";a:2:{i:0;s:7:"21.3675";i:1;s:101:"Shallaki (acide boswellique) est utile dans le traitement de l'arthrite et des douleurs articulaires.";}s:17:"Rumalaya liniment";a:2:{i:0;s:6:"22.425";i:1;s:173:"Rumalaya Liniment est une formulation polyherbacée indiquée pour le contrôle de la douleur et l'inflammation associées aux troubles musculo-squelettiques inflammatoires.";}s:12:"Rumalaya gel";a:2:{i:0;s:6:"22.724";i:1;s:162:"Rumalaya gel est l'application topique puissante, qui a les effets analgésiques puissants et anti-inflammatoires qui offrent un soulagement rapide de la douleur.";}s:14:"Rumalaya forte";a:2:{i:0;s:8:"22.27875";i:1;s:95:"Rumalaya Forte est un analgésique anti-inflammatoire efficace avec l'action immunomodulatrice.";}s:8:"Rumalaya";a:2:{i:0;s:8:"21.69375";i:1;s:120:"Rumalaya est une formule unique d'herbes qui aide à maintenir les articulations saines et réduire la raideur matinale.";}s:7:"Colospa";a:2:{i:0;s:8:"0.872025";i:1;s:343:"Colospa (Mebeverine) est utilisée pour soulager les crampes ou les spasmes de l'estomac et des intestins. Le médicament est particulièrement utilisé dans le traitement du syndrome du côlon irritable (SCI) et des conditions similaires. Consultez votre médecin pour obtenir plus d'information sur des applications de Colospa (Mebeverine) .";}s:7:"Ponstel";a:2:{i:0;s:6:"0.3211";i:1;s:71:"Ponstel (Mefenamic Acid) est indiqué pour le traitement de la douleur.";}s:6:"Pletal";a:2:{i:0;s:8:"0.870656";i:1;s:108:"Pletal (Cilostazol) réduit les attaques de claudication intermittente, qui peut survenir après une marche.";}s:7:"Nimotop";a:2:{i:0;s:7:"0.94785";i:1;s:166:"Nimotop (Nimodipine) est utilisé pour améliorer les symptômes provoqués par des spasmes à la suite d'une hémorragie cérébrale (rupture de vaisseaux sanguins).";}s:7:"Imitrex";a:2:{i:0;s:6:"4.1895";i:1;s:181:"Imitrex est utilisé pour traiter la migraine. Imitrex aide à traiter un mal de tête qui a déjà commencé. Il ne prévient pas des maux de tête ou réduit le nombre d'attaques.";}s:8:"Mestinon";a:2:{i:0;s:7:"1.51088";i:1;s:73:"Mestinon (Pyridostigmine) est utilisé pour traiter la myasthénie grave.";}s:8:"Lioresal";a:2:{i:0;s:6:"0.6992";i:1;s:127:"Lioresal (Baclofen) est utilisé pour traiter les spasmes musculaires causés par la sclérose en plaques ou d'autres maladies.";}s:6:"Imuran";a:2:{i:0;s:8:"0.847385";i:1;s:240:"Imuran est un membre du groupe de médicaments immunosuppresseurs. Il est utilisé pour réduire l'immunité naturelle de l'organisme aux patients qui ont une greffe d'organes. Il est également utilisé pour traiter l'arthrite rhumatoïde.";}}s:5:"Other";a:74:{s:9:"Strattera";a:2:{i:0;s:5:"0.513";i:1;s:84:"Strattera est utilisée pour traiter le déficit de l'attention et l'hyperactivité.";}s:9:"Synthroid";a:2:{i:0;s:7:"0.19494";i:1;s:113:"Synthroid est utilisé pour traiter les niveaux faibles des hormones thyroïdiennes et certains types de goitres.";}s:8:"Antabuse";a:2:{i:0;s:6:"0.4275";i:1;s:48:"Antabuse est utilisé pour traiter l'alcoolisme.";}s:8:"Seroquel";a:2:{i:0;s:9:"0.6733125";i:1;s:67:"SEROQUEL (quétiapine) est utilisé pour traiter la schizophrénie.";}s:7:"Abilify";a:2:{i:0;s:6:"0.5508";i:1;s:123:"Abilify est un médicament antipsychotique destiné à soulager des symptômes de schizophrénie et de troubles bipolaires.";}s:7:"Aricept";a:2:{i:0;s:8:"0.744705";i:1;s:197:"Aricept est utilisé pour traiter la démence (l'altération de la mémoire, le jugement et la pensée abstraite; des changements dans la personnalité) aux patients qui ont la maladie d'Alzheimer.";}s:7:"Zyprexa";a:2:{i:0;s:8:"0.301796";i:1;s:151:"Zyprexa est utilisé pour traiter les symptômes de conditions psychotiques telles que la schizophrénie et le trouble bipolaire (maniaco-dépression).";}s:9:"Neurontin";a:2:{i:0;s:9:"0.5514636";i:1;s:81:"Neurontin est utilisé pour traiter les convulsions associées avec l'épilepsie.";}s:6:"Zofran";a:2:{i:0;s:9:"0.3355856";i:1;s:123:"Zofran est utilisé pour prévenir les nausées et vomissements associées à chimiothérapie anticancéreuse ou chirurgie.";}s:7:"Topamax";a:2:{i:0;s:9:"1.8298368";i:1;s:72:"Topamax est utilisé pour traiter les convulsions aux certains patients.";}s:12:"Methotrexate";a:2:{i:0;s:6:"1.2675";i:1;s:87:"Le méthotrexate est un antimétabolite utilisé pour traiter certains types de cancer.";}s:8:"Depakote";a:2:{i:0;s:8:"0.727776";i:1;s:81:"Depakote est utilisé pour traiter les types différents de crises épileptiques.";}s:8:"Coumadin";a:2:{i:0;s:9:"0.2868525";i:1;s:287:"Coumadin est utilisé pour traiter et prévenir les caillots nuisibles qui peuvent survenir dans les veines (la thrombose veineuse), dans les poumons (l'embolie pulmonaire), avec un type d'arythmie cardiaque (la fibrillation auriculaire), ou après un remplacement de la valve cardiaque.";}s:9:"Risperdal";a:2:{i:0;s:9:"1.2736802";i:1;s:145:"Risperdal est un agent psychotrope utilisé pour guérir la schizophrénie, la manie bipolaire, l'irritabilité associée aux troubles d'autisme.";}s:8:"Lamictal";a:2:{i:0;s:8:"0.939246";i:1;s:65:"Lamictal est utilisé pour traiter certains types de convulsions.";}s:9:"Trileptal";a:2:{i:0;s:8:"0.662625";i:1;s:102:"Trileptal est utilisé pour traiter certains types de saisies aux patients qui souffrent d'épilepsie.";}s:6:"Requip";a:2:{i:0;s:9:"0.4836678";i:1;s:97:"Requip est utilisé pour traiter la maladie de Parkinson et le syndrome des jambes inquiétantes.";}s:9:"Compazine";a:2:{i:0;s:9:"0.3347192";i:1;s:154:"Compazine est utilisé pour traiter les troubles psychotiques comme la schizophrénie, et dans le traitement anti-émétique des nausées et des vertiges.";}s:8:"Zyloprim";a:2:{i:0;s:10:"0.30858375";i:1;s:171:"Zyloprim est utilisé pour traiter la goutte et les niveaux élevés d'acide urique dans le sang ou l'urine causées par certains types de chimiothérapie anticancéreuse.";}s:8:"Dilantin";a:2:{i:0;s:9:"0.4779621";i:1;s:49:"Dilantin est utilisé pour contrôler les crises.";}s:8:"Antivert";a:2:{i:0;s:9:"0.3415782";i:1;s:128:"Antivert est utilisé pour prévenir et traiter la nausée, le vomissement et l'étourdissement associés au mal des transports.";}s:7:"Midamor";a:2:{i:0;s:9:"0.3903075";i:1;s:226:"Midamor est utilisé pour prévenir le développement de potassium dans le sang ou pour aider à restaurer le niveau normal de potassium dans le sang aux patients qui ont l'hypertension artérielle ou l'insuffisance cardiaque.";}s:9:"Meclizine";a:2:{i:0;s:9:"0.4007157";i:1;s:136:"Meclizine est utilisé pour prévenir et traiter les nausées, les vomissements et les étourdissements associés au mal des transports.";}s:9:"Combivent";a:2:{i:0;s:8:"38.17176";i:1;s:156:"Aérosol Combivent est utilisé pour traiter la bronchopneumopathie chronique obstructive (BPCO) aux patients qui ont besoin de plus d'un bronchodilatateur.";}s:6:"Exelon";a:2:{i:0;s:8:"0.585675";i:1;s:0:"";}s:10:"Amantadine";a:2:{i:0;s:8:"0.701784";i:1;s:209:"Amantadine est utilisé pour prévenir et traiter certaines formes de grippe. Il est utilisé pour traiter la maladie de Parkinson et des mouvements musculaires incontrôlés causée par certains médicaments.";}s:6:"Haldol";a:2:{i:0;s:8:"1.415576";i:1;s:51:"Haldol est utilisé pour traiter la schizophrénie.";}s:9:"Isoniazid";a:2:{i:0;s:8:"0.381216";i:1;s:64:"Isoniazid est utilisé pour traiter ou prévenir la tuberculose.";}s:7:"Flonase";a:2:{i:0;s:9:"28.610252";i:1;s:159:"Flonase est utilisé pour traiter l'inflammation, l'allergie, le prurit qui apparaissent chez les patients atteints de rhinite allergique, l'asthme, l'eczéma.";}s:11:"Allopurinol";a:2:{i:0;s:8:"0.667128";i:1;s:131:"Allopurinol est un arthrifuge qui inhibe xanthine oxidase et prévient la formation d'acide urique, de xanthine et de hypoxanthine.";}s:8:"Clozaril";a:2:{i:0;s:9:"0.2716886";i:1;s:151:"Clozaril est une antipsycotic atypique. Il est utilisé pour traiter la schizophrénie chez les patients qui ne répondent pas aux autres médicaments.";}s:7:"Actonel";a:2:{i:0;s:6:"5.8058";i:1;s:446:"Actonel (risédronate) se trouve dans un groupe de médicaments appelés bisphosphonates (bis FOS fo nayts). Risédronate modifie le cycle de formation de l'os et la désintégration dans le corps. Actonel ralentit la perte osseuse en augmentant la masse osseuse, ce qui peut prévenir les fractures osseuses. Actonel est utilisé pour traiter ou prévenir l'ostéoporose. Actonel est également utilisé pour traiter la maladie osseuse de Paget.";}s:5:"Arava";a:2:{i:0;s:7:"1.24245";i:1;s:307:"Arava est utilisée pour soulager les symptômes causés par l'arthrite rhumatoïde, comme l'inflammation, l'enflure, la raideur et des douleurs articulaires. Ce médicament  fonctionne en empêchant l'organisme de produire trop de cellules immunitaires qui sont responsables de l'enflure et l'inflammation.";}s:7:"Xalatan";a:2:{i:0;s:7:"47.8555";i:1;s:129:"Xalatan est un médicament anti-glaucome. Il peut également être utilisé aux autres fins qui n'ont pas été mentionnées ici.";}s:6:"Asacol";a:2:{i:0;s:7:"0.97785";i:1;s:227:"Asacol est utilisé pour traiter et prévenir une maladie inflammatoire de l'intestin appelée la colite ulcéreuse. Il fonctionne à l'intérieur des intestins pour réduire l'inflammation et d'autres symptômes de la maladie.";}s:5:"V-gel";a:2:{i:0;s:7:"23.6511";i:1;s:108:"V-gel est un gel à base de herbes qui est utilisé pour le traitement de vaginites, cervicite, leucorrhée.";}s:7:"Albenza";a:2:{i:0;s:8:"0.355509";i:1;s:171:"Albenza est utilisée pour traiter les infections causées par des vers. Albendazole empêche le ver d'absorber le sucre (glucose) et suscite la destruction des parasites.";}s:7:"Sinemet";a:2:{i:0;s:6:"0.8442";i:1;s:108:"Sinemet (Carbiodopa/Levodopa) est utilisé pour traiter les symptômes associés à la maladie de Parkinson.";}s:8:"Betoptic";a:2:{i:0;s:9:"10.362275";i:1;s:155:"Betoptic est indiqué pour le traitement de la pression intraoculaire élevée aux patients qui ont le glaucome à angle ouvert ou l'hypertension oculaire.";}s:6:"Brahmi";a:2:{i:0;s:6:"21.645";i:1;s:71:"Brahmi est eutilisé pour aider à apprendre et améliorer la mémoire.";}s:11:"Chloroquine";a:2:{i:0;s:6:"1.1285";i:1;s:274:"Chloroquine est un médicament utilisé pour prévenir et traiter le paludisme, une infection des globules rouges transmis par la piqûre d'un moustique, et pour traiter certaines affections comme la maladie du foie causée par des protozoaires (des animaux unicellulaires).";}s:9:"Rocaltrol";a:2:{i:0;s:8:"1.501608";i:1;s:100:"Rocaltrol (Calcitrol) est une forme de vitamine D, nécessaire pour le développement osseux normal.";}s:11:"Cyklokapron";a:2:{i:0;s:6:"2.0739";i:1;s:159:"Cyklokapron (L'acide tranexamique) est utilisé pour le contrôle à court terme du saignement aux hémophiles, y compris les procédés d'extraction dentaire.";}s:7:"Cytoxan";a:2:{i:0;s:9:"1.1809798";i:1;s:316:"Cytoxan est utilisé pour traiter le cancer des ovaires, du sein, du sang et la lymphe, des nerfs (principalement aux enfants), le rétinoblastome (le cancer de l'œil se rencontre principalement aux enfants), le myélome multiple (le cancer de la moelle osseuse), et les mycoses fongoïdes (des tumeurs de la peau).";}s:7:"Reminyl";a:2:{i:0;s:7:"2.96548";i:1;s:235:"Reminyl (Galantamine) est un inhibiteur de la cholinestérase qui augmente la quantité d'une certaine substance (l'acétylcholine) dans le cerveau, ce qui diminue les symptômes de démence aux patients qui ont la maladie d'Alzheimer.";}s:6:"Detrol";a:2:{i:0;s:9:"0.9902496";i:1;s:145:"Detrol est utilisé pour traiter la vessie hyperactive avec les symptômes de la fréquence urinaire, de l'urgence, et de l'incontinence d'urine.";}s:9:"Diltiazem";a:2:{i:0;s:8:"0.722304";i:1;s:163:"Diltiazem est un membre d'un groupe de médicaments appelés les inhibiteurs calciques. Il fonctionne en relâchant les muscles du cœur et des vaisseaux sanguins.";}s:9:"Dramamine";a:2:{i:0;s:6:"0.5771";i:1;s:159:"Dramamine est une médecine antihistaminique et anticholinergique. Il fonctionne dans le cerveau pour diminuer la nausée, le vomissement et l'étourdissement.";}s:8:"Dulcolax";a:2:{i:0;s:8:"0.432817";i:1;s:137:"Dulcolax est un laxatif stimulant. Il enfluence directement sur les intestins, stimule les muscles de l'intestin pour provoquer la selle.";}s:8:"Duphalac";a:2:{i:0;s:9:"31.541818";i:1;s:61:"Duphalac est utilisé pour traiter la constipation chronique.";}s:8:"Eldepryl";a:2:{i:0;s:6:"0.6764";i:1;s:300:"Eldepryl est utilisé en combinaison avec lévodopa ou avec lévodopa et carbidopa pour traiter la maladie de Parkinson (parfois appelé la paralysie agitante). Ce médicament vise à augmenter et prolonger les effets de lévodopa, et peut aider à ralentir la progression de la maladie de Parkinson.";}s:10:"Epivir-HBV";a:2:{i:0;s:9:"0.8749728";i:1;s:88:"Epivir-HBV est utilisé pour traiter certains types de virus de l'hépatite B chronique.";}s:7:"Oxytrol";a:2:{i:0;s:8:"0.826272";i:1;s:213:"Oxytrol est utilisé pour soulager les symptômes de problèmes vésicals (l'urgence urinaire, la fréquence, ou l'écoulement, la perte de contrôle de la vessie, et la miction douloureuse) aux certains patients.";}s:10:"Olanzapine";a:2:{i:0;s:6:"0.6762";i:1;s:129:"Olanzapine est utilisé pour le traitement de courte durée de l'agitation causée par la schizophrénie ou le trouble bipolaire.";}s:9:"Nootropil";a:2:{i:0;s:8:"1.015476";i:1;s:54:"Nootropil réduit la durée du nystagmus vestibulaire.";}s:9:"Minomycin";a:2:{i:0;s:7:"1.76472";i:1;s:69:"Minomycin Capsules sont utilisées pour traiter certaines infections.";}s:15:"Mentat DS syrup";a:2:{i:0;s:7:"35.8575";i:1;s:168:"Mentat DS est une formulation phytopharmaceutique recommandée pour améliorer les fonctions neurologiques des personnes qui souffrent de troubles neurodégénératifs.";}s:6:"Mentat";a:2:{i:0;s:7:"24.7912";i:1;s:127:"Mentat est une formule de fitness mentale qui soutient le fonctionnement du cerveau dans les situations normales et exigeantes.";}s:6:"Liv 52";a:2:{i:0;s:8:"24.19536";i:1;s:110:"Liv.52 est une formulation à double concentration hepatospecific, utilisé pour traiter les troubles du foie.";}s:6:"Hydrea";a:2:{i:0;s:8:"1.517625";i:1;s:284:"Hydrea (Hydroxyurée) est utilisée pour traiter le mélanome, la leucémie myéloïde chronique, le cancer des ovaires et le carcinome spino-cellulaire primaire, le carcinome de la tête et du cou (à l'exception de la lèvre), la leucémie myelogene chronique, l'anémie falciforme.";}s:9:"Indinavir";a:2:{i:0;s:8:"3.436416";i:1;s:160:"Indinavir est un inhibiteur de la protéase du VIH utilisée en combinaison avec d'autres médicaments pour traiter le virus d'immunodéficience humaine (VIH). ";}s:6:"Keppra";a:2:{i:0;s:8:"1.742072";i:1;s:94:"Keppra (lévétiracétam) est un médicament antiépileptique, aussi appelé anticonvulsivant.";}s:6:"Kytril";a:2:{i:0;s:6:"1.8414";i:1;s:169:"Kytril est utilisé pour prévenir la nausée et le vomissement qui peuvent être causés par les médicaments 	anticancéreux (la chimiothérapie ou la radiothérapie).";}s:9:"Plaquenil";a:2:{i:0;s:6:"2.3997";i:1;s:301:"Plaquenil (hydroxychloroquine) est utilisé pour traiter ou prévenir la malaria, une maladie causée par des parasites qui pénètrent dans l'organisme par la piqûre d'un moustique. Plaquenil est également utilisé pour traiter les symptômes de la polyarthrite rhumatoïde et lupus érythémateux.";}s:8:"Kemadrin";a:2:{i:0;s:9:"0.7941825";i:1;s:142:"Kemadrin est utilisé pour traiter la rigidité, les tremblements, les spasmes, et un mauvais contrôle musculaire de la maladie de Parkinson.";}s:6:"Solian";a:2:{i:0;s:6:"2.5472";i:1;s:0:"";}s:7:"Copegus";a:2:{i:0;s:8:"3.761373";i:1;s:58:"Copegus est utilisé pour traiter l'hépatite chronique C.";}s:7:"Renalka";a:2:{i:0;s:8:"25.09672";i:1;s:112:"Sirop Renalka améliore les symptômes urinaires tels que la miction brûlante, la fréquence de la miction, etc";}s:9:"Meldonium";a:2:{i:0;s:4:"0.77";i:1;s:0:"";}s:8:"Picrolax";a:2:{i:0;s:9:"20.360552";i:1;s:104:"Picrolax est une formulation à base de plantes Himalaya utilisé pour le traitement de la constipation.";}s:10:"Naltrexone";a:2:{i:0;s:8:"6.694384";i:1;s:0:"";}s:7:"Kaletra";a:2:{i:0;s:6:"3.9952";i:1;s:0:"";}s:7:"Clexane";a:2:{i:0;s:6:"128.43";i:1;s:0:"";}s:7:"Victoza";a:2:{i:0;s:8:"430.8396";i:1;s:0:"";}}s:11:"Pain Relief";a:39:{s:10:"Prednisone";a:2:{i:0;s:9:"0.2984748";i:1;s:179:"Prednisone est utilisé pour réduire l'inflammation et soulager des symptômes dans une variété de désordres, en incluant l'arthrite rhumatoïde et les cas sévères d'asthme.";}s:7:"Toradol";a:2:{i:0;s:7:"0.39501";i:1;s:134:"Toradol est utilisé pour le traitement bref (5 jours ou moins) de douleur modérée à sévère, habituellement après une chirurgie.";}s:8:"Cafergot";a:2:{i:0;s:9:"0.6304504";i:1;s:158:"Cafergot est utilisé pour prévenir et traiter certains types de maux de tête (par exemple, la migraine,des variantes de migraine, "le syndrome de Horton").";}s:6:"Maxalt";a:2:{i:0;s:8:"7.054732";i:1;s:67:"Maxalt est utilisé pour traiter la migraine après son apparition.";}s:8:"Pyridium";a:2:{i:0;s:9:"0.7449596";i:1;s:286:"Pyridium est un analgésique des voies urinaires. La manière de son action n’est pas très connue. Il est utilisé pour soulager les douleurs, les brûlures, les mictions spontanées et fréquentes, ainsi que l’inconfort provoqué par l'irritation des voies urinaires inférieures.";}s:7:"Trental";a:2:{i:0;s:9:"0.5489176";i:1;s:78:"Trental est un relaxant musculaire pour traiter la claudication intermittente.";}s:14:"Diclofenac Gel";a:2:{i:0;s:9:"6.9366112";i:1;s:99:"Diclofénac Gel est un AINS, utilisés pour traiter les symptômes de la douleur et l'inflammation.";}s:9:"Phenergan";a:2:{i:0;s:9:"0.3794832";i:1;s:79:"Phenergan est utilisé pour traiter différents types de symptômes d'allergie.";}s:9:"Periactin";a:2:{i:0;s:10:"0.45421875";i:1;s:200:"Periactin est utilisé pour traiter les éternuements, l'écoulement nasal, le larmoiement et la démangeaison des yeux, les éruptions cutanées ainsi que d'autres symptômes d'allergies ou du rhume.";}s:6:"Elavil";a:2:{i:0;s:9:"0.3625884";i:1;s:126:"Elavil est un antidépresseur tricyclique servant à traiter les attaques de panique, la dépression et une douleur présente.";}s:5:"Mobic";a:2:{i:0;s:6:"0.2754";i:1;s:100:"Mobic est un non stéroïdiens anti-inflammatoire qui est utilisé dans le traitement de l'arthrite.";}s:6:"Motrin";a:2:{i:0;s:8:"0.784784";i:1;s:134:"Motrin est un medicament anti-inflammatoire avec des propriétés analgésiques utilisé dans le traitement de rhumatisme et arthrite.";}s:8:"Naprosyn";a:2:{i:0;s:8:"0.708472";i:1;s:186:"Naprosyn est utilisée pour réduire la douleur intense, l'inflammation et la raideur provoquée par les conditions comme osteoarthritis, arthrite rhumatoïde, psoriatic l'arthrite, etc.";}s:8:"Voltaren";a:2:{i:0;s:9:"0.2716886";i:1;s:127:"Voltaren est un AINS, il réduit l'inflammation et la douleur chez les patients souffrant d'arthrite ou d’une blessure grave.";}s:5:"Aleve";a:2:{i:0;s:7:"0.73112";i:1;s:209:"Aleve est utilisé pour traiter la douleur ou l'inflammation causées par des conditions telles que l'arthrite, la spondylarthrite ankylosante, la tendinite, la bursite, la goutte, ou les crampes menstruelles.";}s:7:"Voveran";a:2:{i:0;s:6:"0.4158";i:1;s:159:"Voveran est utilisé pour traiter la douleur légère à modérée. Il peut également être utilisé pour les autres conditions déterminées par un médecin.";}s:10:"Voveran sr";a:2:{i:0;s:5:"0.165";i:1;s:162:"Voveran SR est utilisé pour traiter la douleur légère à modérée. Il peut également être utilisé pour les autres conditions déterminées par un médecin.";}s:6:"Anacin";a:2:{i:0;s:8:"0.432288";i:1;s:324:"Anacin est un analgésique destiné au soulagement temporaire des douleurs mineures. Anacin est une combinaison du salicylate et défatigant. Il fonctionne en bloquant plusieurs procédés chimiques dans le corps qui causent la douleur, l'inflammation et la fièvre. Il réduit également la tendance du sang à se coaguler.";}s:6:"Artane";a:2:{i:0;s:8:"0.426426";i:1;s:449:"Artane est utilisé pour traiter la rigidité, le tremblement, les spasmes, et le mauvais contrôle musculaire aux patients qui ont la maladie de Parkinson. Il est également utilisé pour traiter et prévenir les mêmes conditions musculaires quand ils sont causés par des médicaments tels que la chlorpromazine (Largactil), la fluphénazine (Prolixin), la perphénazine (Trilafon), l'halopéridol (Haldol), le thiothixène (Navane), et d'autres.";}s:7:"Aspirin";a:2:{i:0;s:9:"20.393536";i:1;s:170:"Aspirine est un membre d'un groupe de médicaments appelés les salicylates. Il réduit les substances dans le corps qui causent la douleur, la fièvre et l'inflammation.";}s:7:"Urispas";a:2:{i:0;s:8:"1.080112";i:1;s:167:"Urispas est utilisé pour soulager la douleur, la fréquence et l'urgence de l'urination ainsi que urinations nocturnes associées aux certaines conditions médicales.";}s:10:"Azulfidine";a:2:{i:0;s:7:"0.71724";i:1;s:158:"Azulfidine est utilisé pour traiter la rectocolite hémorragique. Il est également utilisé pour augmenter le temps entre les attaques de colite ulcéreuse.";}s:8:"Tegretol";a:2:{i:0;s:8:"0.504792";i:1;s:229:"Tegretol (Carbamazepine) est utilisé pour contrôler certains types de crises épileptiques et pour traiter la douleur aiguë dans la mâchoire ou dans les joues causée par un problème de nerf facial (névralgie du trijumeau).";}s:10:"Tizanidine";a:2:{i:0;s:7:"2.40084";i:1;s:61:"Tizanidine est utilisé pour traiter les spasmes musculaires.";}s:8:"Shallaki";a:2:{i:0;s:7:"21.3675";i:1;s:101:"Shallaki (acide boswellique) est utile dans le traitement de l'arthrite et des douleurs articulaires.";}s:17:"Rumalaya liniment";a:2:{i:0;s:6:"22.425";i:1;s:173:"Rumalaya Liniment est une formulation polyherbacée indiquée pour le contrôle de la douleur et l'inflammation associées aux troubles musculo-squelettiques inflammatoires.";}s:12:"Rumalaya gel";a:2:{i:0;s:6:"22.724";i:1;s:162:"Rumalaya gel est l'application topique puissante, qui a les effets analgésiques puissants et anti-inflammatoires qui offrent un soulagement rapide de la douleur.";}s:14:"Rumalaya forte";a:2:{i:0;s:8:"22.27875";i:1;s:95:"Rumalaya Forte est un analgésique anti-inflammatoire efficace avec l'action immunomodulatrice.";}s:8:"Rumalaya";a:2:{i:0;s:8:"21.69375";i:1;s:120:"Rumalaya est une formule unique d'herbes qui aide à maintenir les articulations saines et réduire la raideur matinale.";}s:7:"Colospa";a:2:{i:0;s:8:"0.872025";i:1;s:343:"Colospa (Mebeverine) est utilisée pour soulager les crampes ou les spasmes de l'estomac et des intestins. Le médicament est particulièrement utilisé dans le traitement du syndrome du côlon irritable (SCI) et des conditions similaires. Consultez votre médecin pour obtenir plus d'information sur des applications de Colospa (Mebeverine) .";}s:7:"Ponstel";a:2:{i:0;s:6:"0.3211";i:1;s:71:"Ponstel (Mefenamic Acid) est indiqué pour le traitement de la douleur.";}s:6:"Pletal";a:2:{i:0;s:8:"0.870656";i:1;s:108:"Pletal (Cilostazol) réduit les attaques de claudication intermittente, qui peut survenir après une marche.";}s:7:"Nimotop";a:2:{i:0;s:7:"0.94785";i:1;s:166:"Nimotop (Nimodipine) est utilisé pour améliorer les symptômes provoqués par des spasmes à la suite d'une hémorragie cérébrale (rupture de vaisseaux sanguins).";}s:7:"Imitrex";a:2:{i:0;s:6:"4.1895";i:1;s:181:"Imitrex est utilisé pour traiter la migraine. Imitrex aide à traiter un mal de tête qui a déjà commencé. Il ne prévient pas des maux de tête ou réduit le nombre d'attaques.";}s:8:"Mestinon";a:2:{i:0;s:7:"1.51088";i:1;s:73:"Mestinon (Pyridostigmine) est utilisé pour traiter la myasthénie grave.";}s:8:"Lioresal";a:2:{i:0;s:6:"0.